const INITIAL_STATE = {
    respuestasT: [
        {
            'id': 1,
            'texto': 'texto respuestas trivia 1'
        },
        {
            'id': 2,
            'texto': 'texto respuestas trivia 2'
        },
        {
            'id': 3,
            'texto': 'texto respuestas trivia 3'
        },
        {
            'id': 4,
            'texto': 'texto respuestas trivia 4'
        },
    ],
    lastId: 4
};

export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case 'traer_respuestasT':
            return { ...state, respuestasT: action.payload }
        case 'crear_respuestasT':
            return {
                ...state,
                respuestasT: action.payload
            }
        case 'editar_respuestasT':
            return {
                ...state,
                respuestasT: action.payload
            }
        case 'eliminar_respuestasT':
            return {
                ...state,
                respuestasT: action.payload
            }
        default:
            return state;
    }
}
